const containerStyle={
    display:"flex",
    alignItems:"center",
    gap:"16px",
}
const starContainerStyle={
    display:"flex",
    gap:"4px",
}
const textStyle={
    lineHeight:"1",
    margin:"0",
}

export default function StarRating({maxRating}){
    return <div style={containerStyle}>
        <div style={starContainerStyle}>
            {Array.from({length:maxRating}),(_,i)=>(<span>&#9734;</span>)}
        </div>
        <p style={textStyle}></p>
    </div>
}
